
package com.searchbar.sweng.searchbar;
import com.searchbar.sweng.searchbar.model.Event.EventPublisher;
import com.searchbar.sweng.searchbar.model.Event.RezeptAddedEvent;
import com.searchbar.sweng.searchbar.model.Event.UserRegisteredEvent;
import com.searchbar.sweng.searchbar.model.Food;
import com.searchbar.sweng.searchbar.model.Menueart;
import com.searchbar.sweng.searchbar.model.Rezepte;
import com.searchbar.sweng.searchbar.model.Unvertraeglichkeiten;
import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import org.springframework.cloud.stream.binder.test.OutputDestination;
import org.springframework.cloud.stream.binder.test.TestChannelBinderConfiguration;
import org.springframework.context.annotation.Import;
import com.fasterxml.jackson.databind.ObjectMapper;

import java.util.ArrayList;

import static org.junit.jupiter.api.Assertions.*;

@SpringBootTest(webEnvironment = SpringBootTest.WebEnvironment.NONE)
@Import(TestChannelBinderConfiguration.class)
public class EventPublisherTests {

    @Autowired
    private OutputDestination outputDestination;

    @Autowired
    private EventPublisher eventPublisher;

    @Test
    void testPublishEvent() throws Exception {
        ArrayList foods = new ArrayList();
        System.out.println();
        foods.add(new Food("Fleisch",200,400,"400G"));
        Unvertraeglichkeiten uv = new Unvertraeglichkeiten(false,false,false);
        String image = "data:image/webp;base64,";
        Rezepte rezept = new Rezepte("Fleisch A",2,4,2,Menueart.FRÜHSTÜCK,false,false,foods,uv,image);
        var event = new RezeptAddedEvent(rezept);
        this.eventPublisher.publishEvent(event);
        var receivedMessage = this.outputDestination.receive();
        assertNotNull(receivedMessage);
        assertTrue(receivedMessage.getPayload().length > 0);
        var payloadObject = (new ObjectMapper()).readValue(receivedMessage.getPayload(), RezeptAddedEvent.class);
        assertEquals(event, payloadObject);
    }
}
